import React from "react";

const ProductForm = () => {
  return (
    <div className="Product_form_container">
      <div className="Product_card">
        <form>
          <div className="col-md-3">
            <input type="text" placeholder="Product Name" name="name" />
          </div>
        </form>
      </div>
    </div>
  );
};

export default ProductForm;
